import React, {useState} from 'react'
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import {useHistory, useLocation} from "react-router";

export default function PersonalData(){
    const history = useHistory();

    const [name, setName] = useState({
        name : null
    });
    const [age, setAge] = useState({
        age : null
    });
    const [gender, setGender] = useState({
        gender : null
    });
    const [region, setRegion] = useState({
        region : null
    });

    const pushdataToPsychometry = () =>{
        history.push({
            pathname: "/Psychometry",
            state: {
                pname : name.value,
                page : age.value,
                pgender : gender.value,
                pregion : region.value
            }
        })
    };

    return(
        <div>
            <h1>
                인적사항 기입 페이지
            </h1>
            <Form>
                <Form.Group controlId="name">
                    <Form.Label>이름</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="이름을 입력해주세요"
                        onChange={(e) => {
                            setName(e.target);
                        }}
                    ></Form.Control>
                </Form.Group>

                <Form.Group controlId="age">
                    <Form.Label>연령대</Form.Label>
                    <Form.Control
                        as="select" custom
                        onChange={(e) => {
                            setAge(e.target);
                        }}
                    >
                        <option>10대</option>
                        <option>20대</option>
                        <option>30대</option>
                        <option>40대</option>
                        <option>50대</option>
                        <option>60대 이상</option>
                    </Form.Control>
                </Form.Group>

                <Form.Group controlId="gender">
                    <Form.Label>성별</Form.Label>
                    <Form.Control
                        as="select" custom
                        onChange={(e) => {
                            setGender(e.target);
                        }}
                    >
                        <option>남</option>
                        <option>여</option>
                    </Form.Control>
                </Form.Group>

                <Form.Group controlId="region">
                    <Form.Label>지역</Form.Label>
                    <Form.Control
                        as="select" custom
                        onChange={(e) =>{
                            setRegion(e.target);
                        }}
                    >
                        <option>서울</option>
                        <option>경기</option>
                        <option>인천</option>
                        <option>강원</option>
                        <option>충북</option>
                        <option>충남</option>
                        <option>대전</option>
                        <option>세종</option>
                        <option>대구</option>
                        <option>전북</option>
                        <option>전남</option>
                        <option>부산</option>
                        <option>경북</option>
                        <option>경남</option>
                        <option>제주</option>
                    </Form.Control>
                </Form.Group>                
            </Form>
            <Button varient="primary" onClick={pushdataToPsychometry}>다음</Button>

            <p>이름 : {name.value}</p>
            <p>나이 : {age.value}</p>
            <p>성별 : {gender.value}</p>
            <p>지역 : {region.value}</p>
        </div>
    );
}
